import React from 'react'
import Button from 'react-bootstrap/esm/Button'
import { LinkuseNavigate } from 'react-router-dom'

function Homepg() {

    const nvar=useNavigate();
    const regnav=()=>{
        nvar("/register");
    }
  return (
    <div>
        <div>Welcome to Employee Management Application...</div><br/>
        <center>
            <Button><Link to={"/login"}>LOGIN</Link></Button>&nbsp;&nbsp;
            <Button onClick={regnav}><Link to={"/register"}>REGISTER</Link></Button>
        </center>
    </div>
  )
}

export default Homepg
